// components/Header.js

import React, { Component } from 'react'
import { Input, Menu } from 'semantic-ui-react'

const headerStyle = {
    backgroundColor: "blue",
    color: "white",
    width: "100%",
    height: "50px"
  };
  
  const Header = () => (
    <div className="Header" style={headerStyle}>
         <NavBar />


    </div>
  );
  
  export default Header;
